import React from 'react';
import "./Entry.css";



const Entry = ({type,placeholder,value,onChange,error}) => {
  return (
    <div>
    <input className='tags' type={type} placeholder={placeholder}  value={value} onChange={onChange}/>
    {error && <span className="error">{error}</span>}
    
    </div>
  )
}

export default Entry
